Coming Back (Al-Jazeera)

History Documentary hosted by Ahmet Seven, published by Al-Jazeera broadcasted as part of Al-Jazeera World series in 2013 - English narration


Information
------------------------------

In 1944, Stalin deported 218,000 Crimean Tatars to Central Asia - we tell the story of their struggle to return home. Using personal testimonies, this film tells the story of the Tatars' expulsion from their homeland and their long struggle to return. It was only in 1989, with the opening up of the Soviet Union, that they were able to come back in large numbers. Most, finding Russians living in their former homes, built shacks in which to live. Today, 300,000 Tatars live in Crimea - 5,000 of them still in shacks. Even those with houses suffer because they only have minority status. Despite this, 150,000 more are still hoping to return home.
An Al Jazeera production.

